import axios from 'axios'
import React from 'react'
import { useNavigate } from 'react-router'

const DeleteBtn = (props) => {
    const id = props.id

    const deleteServerData = async () => {
        try {
            await axios.delete(`http://localhost:8080/dashboard/deleteUser/${id}`)
            navigate('/dashboard/adduser');
        } catch (error) {
            console.log(error)
        }
    }
    let navigate = useNavigate();

    return (
        <>
            {/* <button id='submit' className="btn text-dark" onClick={deleteServerData} type="submit" value="Delete" style={{ marginLeft: '0.5rem' }} /> */}
            <button id='submit' className="btn text-dark" onClick={deleteServerData} type="submit" value="Delete" style={{ marginLeft: '0.5rem' }}>Delete</button>
        </>
    )
}

export default DeleteBtn
